// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract VotingContract {
    struct Candidate {
        string name;
        string party;
        string election;
        uint age;
        string email;
        string idNo;
        uint totalVoteCount; // Keeps track of the total votes for this candidate
    }

    mapping(address => bool) public voters;
    mapping(string => Candidate) public candidates;  // Mapping from candidate ID (string) to Candidate
    mapping(address => bool) public admins;
    mapping(string => mapping(string => uint256)) public candidateProvinceVotes;  // Store votes by candidate and province
    mapping(string => bool) public mintingStatus; // Tracks if minting is in progress for a province
    string[] public candidateIds; // Array of candidate IDs
    uint256 public candidatesCount;  // Total number of candidates
    address public owner;

    event VoteCast(address indexed voter, string candidateId, string province);
    event AdminAdded(address indexed newAdmin);
    event AdminRemoved(address indexed removedAdmin);
    event VotesMinted(string province, uint totalVotes);
    event ContractDeployed(address owner); // New event for debugging

    modifier onlyOwner() {
        require(msg.sender == owner, "Only the owner can perform this action");
        _;
    }

    modifier onlyAdmin() {
        require(admins[msg.sender], "Only admins can perform this action");
        _;
    }

    modifier notMinting(string memory _province) {
        require(!mintingStatus[_province], "Minting is currently in progress for this province");
        _;
    }

    constructor() {
        owner = msg.sender;
        admins[owner] = true;
        emit ContractDeployed(owner); // Log contract deployment
    }

    function addCandidate(
        string memory _name,
        string memory _party,
        string memory _election,
        uint _age,
        string memory _email,
        string memory _idNo
    ) public onlyAdmin {
        Candidate memory newCandidate = Candidate(_name, _party, _election, _age, _email, _idNo, 0);
        candidates[_idNo] = newCandidate;
        candidateIds.push(_idNo);  // Add candidate ID to array for tracking
        candidatesCount++;
    }

    function vote(string memory _candidateId, string memory _province) public {
        require(!voters[msg.sender], "You have already voted");
        require(bytes(candidates[_candidateId].idNo).length != 0, "Invalid candidate ID");

        voters[msg.sender] = true;
        candidateProvinceVotes[_candidateId][_province]++;
        candidates[_candidateId].totalVoteCount++;

        emit VoteCast(msg.sender, _candidateId, _province);
    }

    function mintVotes(string memory _province) public onlyAdmin notMinting(_province) {
        uint totalVotes = 0;

        for (uint i = 0; i < candidateIds.length; i++) {
            string memory candidateId = candidateIds[i];
            totalVotes += candidateProvinceVotes[candidateId][_province];
            candidateProvinceVotes[candidateId][_province] = 0;
        }

        mintingStatus[_province] = false;
        emit VotesMinted(_province, totalVotes);
    }

    function getWinnerInProvince(string memory _province) public view returns (string memory name, string memory party, uint voteCount) {
        uint maxVotes = 0;
        string memory winningCandidateId;

        for (uint i = 0; i < candidateIds.length; i++) {
            string memory candidateId = candidateIds[i];
            uint candidateVotes = candidateProvinceVotes[candidateId][_province];
            if (candidateVotes > maxVotes) {
                maxVotes = candidateVotes;
                winningCandidateId = candidateId;
            }
        }

        return (candidates[winningCandidateId].name, candidates[winningCandidateId].party, maxVotes);
    }

    function getCandidateVotesInProvince(string memory _candidateId, string memory _province) public view returns (uint) {
        require(bytes(candidates[_candidateId].idNo).length != 0, "Invalid candidate");
        return candidateProvinceVotes[_candidateId][_province];
    }

    function getTotalVotesForCandidate(string memory _candidateId) public view returns (uint) {
        require(bytes(candidates[_candidateId].idNo).length != 0, "Invalid candidate");
        return candidates[_candidateId].totalVoteCount;
    }

    function addAdmin(address _admin) public onlyOwner {
        require(!admins[_admin], "Address is already an admin");
        admins[_admin] = true;
        emit AdminAdded(_admin);
    }

    function removeAdmin(address _admin) public onlyOwner {
        require(admins[_admin], "Address is not an admin");
        admins[_admin] = false;
        emit AdminRemoved(_admin);
    }

    function startMinting(string memory _province) public onlyAdmin notMinting(_province) {
        mintingStatus[_province] = true; // Start minting for the province
    }

    function hasVoted(address _voter) public view returns (bool) {
        return voters[_voter];
    }
}
